import './App.css';
import React, {Component, useState} from "react";

function App() {
        const [show, setShow] = useState(false);

        return (
            <>
                <button className="bu" onClick={() => setShow(!show)} hidden={show}>
                </button>
                {
                    show?
                        <button className="bu-red"/>
                        :null
                }
            </>
        );
}

export default App;
